import { UploadOutlined } from '@ant-design/icons';

const RegistroSiniestroForm = () => {

    const { Header } = Layout;

    const [loading, setLoading] = useState(false);
    const nombres = localStorage.getItem('nombre');
    const token = localStorage.getItem('token');

    const [pdfFileList, setPdfFileList] = useState([]);

    const onFinish = async (values) => {
        const formData = new FormData();
        
        console.log("token que se tiene: " + token);
        setLoading(true);
        try {
            values.AjustadorQueRegistra = nombres;
            values.Fecha_Ocurrido = values.Fecha_Ocurrido.format('YYYY-MM-DD');
            values.Fecha_Atencion = values.Fecha_Atencion.format('YYYY-MM-DD');
            if (values.PDF && values.PDF.length > 0) { // Cambiar 'pdf' a 'PDF'
                formData.append('PDF', values.PDF[0].originFileObj); // Cambiar 'pdf' a 'PDF'
            }
            const normFile = (e) => {
                if (Array.isArray(e)) {
                    return e;
                }
                return e && e.fileList;
            };
            const pdfUploadProps = {
                onRemove: (file) => {
                    setPdfFileList((prevList) => prevList.filter((item) => item.uid !== file.uid));
                },
                beforeUpload: (file) => {
                    setPdfFileList((prevList) => [...prevList, file]);
                    return false;
                },
                fileList: pdfFileList,
            };
                

            const jsonData = JSON.stringify(values); // Serializar los datos como JSON
            console.log("Datos a enviar" + jsonData)
            await axios.post('http://localhost:8000/Siniestros/RegistrarSiniestro', jsonData, {
                headers: {
                    'Content-Type': 'application/json',
                    'Authorization': token,
                }
            });
            message.success('Siniestro registrado correctamente');
        } catch (error) {
            message.error('Error al registrar el siniestro');
        }
        setLoading(false);
    };

    return (
        // <div style={{ backgroundColor: '#4174E0', padding: '20px', borderRadius: '8px' }}>
        <div style={{ backgroundColor: '#4174E0', padding: '20px', borderRadius: '8px', textAlign: 'center' }}>

            <Header style={{ backgroundColor: 'black', textAlign: 'center', paddingBottom: '2rem', borderRadius: '10px', marginBottom: '1rem', width: '100%'}}>
                <h1 className="title">Datos generales del siniestro</h1>
            </Header>

            <div style={{ textAlign: 'center', display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100%', marginTop: '2rem', marginBottom: '2rem'}}>
                <img src="https://cdn-icons-png.flaticon.com/256/12125/12125514.png" style={{maxHeight: '200px'}} alt="Imagen de registro de siniestro"></img>
            </div>
            <div className="circle-background" style={{ position: 'absolute', marginTop: '-90px', marginLeft: '-25px' }}></div>
            <div style={{backgroundColor: '#5995E1', borderRadius: '20px', padding: '1rem', boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.1)' }}>
            <Form
                layout="vertical"
                onFinish={onFinish}
            >
                <Row gutter={16}>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="Numero_Siniestro"
                            label="Número de Siniestro"
                            rules={[{ required: true, message: 'Por favor ingresa el número de siniestro' }]}
                        >
                            <Input />
                        </Form.Item>
                    </Col>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="Folio_Edua"
                            label="Folio EDUA"
                            rules={[{ required: true, message: 'Por favor ingresa el folio EDUA' }]}
                        >
                            <Input />
                        </Form.Item>
                    </Col>
                </Row>
                <Row gutter={16}>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="Fecha_Ocurrido"
                            label="Fecha de Ocurrido"
                            rules={[{ required: true, message: 'Por favor selecciona la fecha' }]}
                        >
                            <DatePicker format="YYYY-MM-DD" style={{ width: '100%' }} />
                        </Form.Item>
                    </Col>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="Fecha_Atencion"
                            label="Fecha de Atención"
                            rules={[{ required: true, message: 'Por favor selecciona la fecha' }]}
                        >
                            <DatePicker format="YYYY-MM-DD" style={{ width: '100%' }} />
                        </Form.Item>
                    </Col>
                </Row>
                <Row gutter={16}>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="Numero_Poliza"
                            label="Número de Póliza"
                            rules={[{ required: true, message: 'Por favor ingresa el número de póliza' }]}
                        >
                            <Input />
                        </Form.Item>
                    </Col>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="Serie_Vin"
                            label="Serie VIN"
                            rules={[{ required: true, message: 'Por favor ingresa la serie VIN' }]}
                        >
                            <Input />
                        </Form.Item>
                    </Col>
                </Row>
                <Row gutter={16}>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="Placa_Vehiculo"
                            label="Placa del Vehículo"
                            rules={[{ required: true, message: 'Por favor ingresa la placa del vehículo' }]}
                        >
                            <Input />
                        </Form.Item>
                    </Col>
                    <Col xs={24} md={12}>
                        <Form.Item
                            name="Estado"
                            label="Estado"
                            rules={[{ required: true, message: 'Por favor ingresa el estado' }]}
                        >
                            <Input />
                        </Form.Item>
                    </Col>
                </Row>
                <Row gutter={16}>
                    <Col xs={24}>
                        <Form.Item
                            name="Ciudad"
                            label="Ciudad"
                            rules={[{ required: true, message: 'Por favor ingresa la ciudad' }]}
                        >
                            <Input />
                        </Form.Item>
                    </Col>
                </Row>
                <Row gutter={16}>
                <Col xs={24}>
                <Form.Item
                label="PDF"
                name="PDF"
                valuePropName="fileList"
                getValueFromEvent={normFile}
            >
                <Upload {...pdfUploadProps}>
                    <Button icon={<UploadOutlined />}>Seleccionar PDF</Button>
                </Upload>
            </Form.Item>

            </Col>
            </Row>

                <Row gutter={16}>
                    <Col xs={24}>
                        <Form.Item>
                            <Button type="primary" htmlType="submit" loading={loading} style={{width: '100%', boxShadow: '0px 2px 4px rgba(0, 0, 0, 0.1)' }}>
                                Registrar Siniestro
                            </Button>
                        </Form.Item>
                    </Col>
                </Row>
            </Form>

            </div>
            <br></br>
            <br></br>
            <br></br>
        </div>
    );
};

export default RegistroSiniestroForm;
